export default {
  data() {
    return {
      selectedCategory: ""
    };
  },
  computed: {
    categoriesList() {
      return this.navList.map(item => item.category);
    },
    navigationsList() {
      return this.navList.find(item => item.category === this.selectedCategory).navigations;
    },
    navList() {
      return this.$store.getters["phone/getNavigationList"];
    }
  },
  methods: {
    goToRoute(nav) {
      const coords = nav.coords;
      if (nav.isSpecial) {
        this.$callClient("W:Phone:GoToSpecialCoords", nav.trigger);
        return;
      }
      if (!coords) return;
      this.$callClient("W:Phone:GoToCoords", coords);
    }
  },
  mounted() {
    this.selectedCategory = this.categoriesList[0];
  }
};
